import React from 'react'
import FirePokemon from './FirePokemon'
import GrassPokemon from './GrassPokemon'
import WaterPokemon from './WaterPokemon'

const HomePage = () => {

  return (
    <>

    <div className='pokemon '> 
      <FirePokemon />
      <WaterPokemon />
      <GrassPokemon />
    </div>
    </>
  )

}

export default HomePage;
